import React from 'react';
import {Link} from 'react-router-dom';

const LINKS=[
        {to:'/',text:''},
        {to:'/contacts',text:'Contacts'}
]
function Navs() {
    return (
        <div>
            <ul>
                {
                    LINKS.map(
                        item=>(
                           <li key={item.to}><Link></Link> </li> 
                        )
                    )
                }
            </ul>
            
        </div>
    );
};

export default Navs
